import React from 'react';
import './style.css'

const Job = (props) => {
    return(
        <div className='w-100'>
            <div className="w-20 flex justify-center ma3"><img className='br3' src={props.logo}/></div>
            <div className='w-60'>{props.title}</div>
        </div>
    );
}

export default Job;
